import {
  Link
} from "react-router-dom"

export default function ProductRouter() {
  return(
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/">Products</Link>
          </li>
          <li>
            <Link to="/details">Product Details</Link>
          </li>
        </ul>
      </nav>
    </div>
  )
}
